import "./App.css";
import React, { Component } from "react";

class App extends Component {
  state = {
    clients: [
      { id: 0, url: "%PUBLIC_URL%/img/img1.png", text: "Test 1" },
      { id: 1, url: "%PUBLIC_URL%/img/img2.png", text: "Test 2" },
      { id: 2, url: "%PUBLIC_URL%/img/img3.png", text: "Test 3" }
    ]
  };

  render() {
    return (
      <div>
        <div class="carousel">
          {this.state.clients.map((item) => (
            <div id={item.id}>
              <div class="arrow">
              </div>
              <p>{item.text}</p>
              <div class="arrow">
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default App;
